import React from "react";

// material ui
import { withStyles } from "@material-ui/core/styles";
import { makeStyles } from "@material-ui/core/styles";

import Tabs from "@material-ui/core/Tabs";
import Tab from "@material-ui/core/Tab";
import Typography from "@material-ui/core/Typography";
import Box from "@material-ui/core/Box";
import TextField from "@material-ui/core/TextField";

import Autocomplete, {
  createFilterOptions,
} from "@material-ui/lab/Autocomplete";

const filterOptions = createFilterOptions({
  matchFrom: "start",
  stringify: (option) => option.specialty,
});

// material ui tab for general sign u and doctor sign up
function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return value === index && <Box t={2}>{children}</Box>;
}

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    "aria-controls": `simple-tabpanel-${index}`,
  };
}

const StyledTabs = withStyles({
  indicator: {
    display: "flex",
    justifyContent: "center",
    backgroundColor: "transparent",
    "& > div": {
      width: "100%",
      backgroundColor: "#FF8686",
    },
  },
})((props) => <Tabs {...props} TabIndicatorProps={{ children: <div /> }} />);

const StyledTab = withStyles((theme) => ({
  root: {
    textTransform: "none",
    color: "#fff",
    fontWeight: "bold",
    fontSize: "1em",
    marginTop: 10,
    "&:focus": {
      opacity: 1,
    },
  },
}))((props) => <Tab disableRipple {...props} />);

export default function SearchTabs() {
  const classes = useStyles();

  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div>
      <div>
        <StyledTabs
          value={value}
          onChange={handleChange}
          aria-label="search tabs"
        >
          <StyledTab
            label="Specialty"
            {...a11yProps(0)}
            style={{ minWidth: 120 }}
          />
          <StyledTab
            label="Doctor"
            {...a11yProps(1)}
            style={{ minWidth: 120 }}
          />
          <StyledTab
            label="Hospital"
            {...a11yProps(2)}
            style={{ minWidth: 120 }}
          />
          <StyledTab
            label="Condition"
            {...a11yProps(3)}
            style={{ minWidth: 120 }}
          />
        </StyledTabs>

        <Typography />
      </div>
      <TabPanel value={value} index={0}>
        <Autocomplete
          options={specialties}
          getOptionLabel={(option) => option.specialty}
          filterOptions={filterOptions}
          style={{ width: 480 }}
          renderInput={(params) => (
            <TextField
              {...params}
              label="Search by specialty"
              variant="filled"
              className={classes.inputRoot}
              InputProps={{ ...params.InputProps, disableUnderline: true }}
            />
          )}
        />
      </TabPanel>

      <TabPanel value={value} index={1}>
        {" "}
        <p>hi</p>
      </TabPanel>

      <TabPanel value={value} index={2}>
        {" "}
        <p>hi</p>
      </TabPanel>
      <TabPanel value={value} index={3}>
        {" "}
        <p>hi</p>
      </TabPanel>
    </div>
  );
}

const specialties = [
  { specialty: "Allergy and Immunology" },
  { specialty: "Anesthesiology" },
  { specialty: "Arthroplasty" },
];

const useStyles = makeStyles((theme) => ({
  inputRoot: {
    "& .MuiFilledInput-root": {
      backgroundColor: "rgba(255,255,255)",
      borderRadius: 4,
    },
  },
}));
